import React from "react";
import ReactDOM from "react-dom";
import MUIDataTable from "mui-datatables";

class App extends React.Component {
  render() {
    const columns = ["Tasks", "Reach", "Impact", "Confidence", "Effort", "Score"];

    const data = [
      ["Get approval from client regarding proposal", 12, 3, "38%", 1, 4500],
      ["Create database", 32, 2, "80%", 9, 4500],
      ["Add list function to legal", 12, 0.45, "30%", 4, 4500],
      ["New design for menu", 2, 2, "99%", 2, 4500],
      ["System design", 6, 1, "45%", 5, 4500],
      ["Architecture design", 13, 1, "65%", 7, 4500],
      ["Analytics implementation", 12, 0.1, "87%", 4, 4500],
      ["Refactor code in list view", 4, 0.5, "23%", 1, 4500],
      ["Add dropdown menus", 7, 0.25, "12%", 1, 4500],
      ["Login form functionality", 8, 2, "67%", 2, 4500],
      ["Login form overlay", 2, 1.5, "89%", 2, 4500],
      ["Upload source to cloud", 9, 2, "56%", 4, 4500],
      ["Buy hosting", 32, 1, "26%", 1, 4500],
      ["Gather user info", 32, 1, "2%", 8, 4500],
      ["Add dropdown function to lists", 6, 0.25, "34%", 1, 4500],
      ["Buy domain", 7, 2, "97%", 1, 4500],
      ["Update React", 3, 1, "90%", 3, 4500],
      ["Get approval from UX", 12, 3, "83%", 1, 4500],
      ["Find UI framework", 2, 1, "51%", 4, 4500],
      ["Fix responsive menu problem with tablets", 8, 0.75, "23%", 1, 4500],
      ["Update database version", 5, 3, "88%", 8, 4500]
    ];

    const options = {
      filterType: "dropdown",
      responsive: "scroll"
    };

    return (
      <MUIDataTable
        title={"Product Board / Scoring Table"}
        data={data}
        columns={columns}
        options={options}
      />
    );
  }
}

ReactDOM.render(<App />, document.getElementById("root"));
